import './App.css';
import { ColourListComponent } from './ColourListComponent.js';
import HelloFirst from './HelloFirst';
import { NestedFunction } from './NestedFuc.js';
import { UsingArrowFunction } from './UsingArrowF';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HelloFirst />
        <UsingArrowFunction />
       <NestedFunction/>
       <div className='hr'>
        <h2>Nested Function Component</h2>
        <p>This is a demonstration of nested components.</p>
       </div>
       <ColourListComponent/>
      </header>
    </div>
  );
}

export default App;
